function App() {
  return (
    <div>
    {/* <Header /> */}



        <Router>
<Route exact path="/" >
  <Home />
  <Home1 />
</Route>
 <Route path="/about">
  <About />
  <Home />
  </Route>
  <Route path="/contact"> 
  <Home />
    <Contact />

  </Route>
</Router> 
</div>



  );
}

function Home1() {

  return <h2>Home</h2>;

}

function About() {
  return <h2>About</h2>;
}

function Contact() {
  return <h2>CONTACT</h2>;
}



export default App;
